 function Form() {
  
  const [name, setName] = useState(" ");
  const handleSubmit = (event) => {
    event.preventDefault();
    alert(`The name you entered was: ${name}`);

  return (
    <form onSubmit={handleSubmit}>
      <label>First Name:
        <input
          type="text" 
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
      </label>

      <label>Surname Name:
        <input
          type="text" 
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
      </label>

      <input type="Submit"/>
    </form>
  )
  }
}
 
export default Form;


